        for i in range(n):
            for j in range(m):
                if grid[i][j] > 0:
                    neighbors = 0
                    if i > 0 and grid[i - 1][j] > 0:
                        neighbors += 1
                    if i < n - 1 and grid[i + 1][j] > 0:
                        neighbors += 1
                    if j > 0 and grid[i][j - 1] > 0:
                        neighbors += 1
                    if j < m - 1 and grid[i][j + 2] > 0:
                        neighbors += 1
                    if neighbors != grid[i][j]:
                        return False
        return True

    def generate_good_grid():
        good_grid = [[0] * m for _ in range(n)]
        for i in range(n):
            for j in range(m):
                if i == 0 or i == n - 1:
                    if j == 0 or j == m - 1:
                        good_grid[i][j] = 2
                    else:
                        good_grid[i][j] = 3
                elif j == 0 or j == m - 1:
                    good_grid[i][j] = 3
                else:
                    good_grid[i][j] = 4
        return good_grid
    if is_possible():
        return (True, generate_good_grid())
    else:
        return (False, None)

